import react from 'react'

const ProProjects = (props) => {
    // console.log(props.data[0].title)
    return (
        <react.Fragment>
            Hello!
            {props.data.map((project, idx) => {
                return (
                    <react.Fragment key={idx}>
                        <div className={projectHeading}>

                        </div>
                        <p>{project.text}</p>
                    </react.Fragment>
                )
            })}
        </react.Fragment>
    )
}

export default ProProjects;
